def separate_paren_groups(paren_string: str) -> List[str]:
    paren_string = paren_string.replace(" ", "")
    result = []
    stack = []
    current_group = ""

    for char in paren_string:
        if char == "(":
            if not stack:
                current_group += char
            stack.append(char)
        elif char == ")":
            stack.pop()
            current_group += char
            if not stack:
