def count_nums(arr):
    def sum_digits(n):
        return sum(int(d) for d in str(n) if d.isdigit())

    def signed_sum_digits(n):
        if n < 0:
            return sum_digits(-n) - 2 * sum_digits(-n // 10)
        else:
            return sum_digits(n)

    return sum(1 for n in arr if signed_sum_digits(n) > 0)

