def match_parens(lst):
    s1, s2 = lst
    if s1.count('(') == s2.count(')') and s1.count(')') == s2.count('('):
        return 'Yes'
    elif s1.count('(') == s2.count('(') and s1.count(')') == s2.count(')'):
        return 'Yes'
    else:
        return 'No'

